import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";


import img1 from "../../../assets/sliderImg1.jpg";
import img2 from "../../../assets/sliderImg2.jpg";
import img3 from "../../../assets/sliderImg3.jpg";
import img4 from "../../../assets/sliderImg4.jpg";
import img5 from "../../../assets/sliderImg5.jpg";

const Services = () => {
    const images = [img1,img2,img3,img4,img5,img1,img2,img3,img4,img5];


    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 4,
        slidesToScroll: 3,

        responsive: [
            {
              breakpoint: 1424,
              settings: {
                slidesToShow: 3,
                slidesToScroll: 3,
                infinite: true,
                dots: true
              },
            },
            {
              breakpoint: 1000,
              settings: {
                slidesToShow: 2,
                slidesToScroll: 2,
                initialSlide: 2
              },
            },
            {
              breakpoint: 680,
              settings: {
                slidesToShow: 1,
                slidesToScroll: 1
              },
            },
          ],
      };

  return (
    <>
       <h1 className="heading">ervices</h1>
       <section className="services">

        <Slider {...settings}>
            {images.map((image) =>{
                return(
                    <div key={image}>
                        <img src={image} alt="" />
                    </div>
                );
            })}
        {/* <div>
           <img src={img1} alt=""/>
          </div>
          <div>
          <img src={img2} alt=""/>         
           </div>
          <div>
          <img src={img3} alt=""/>         
           </div>
          <div>
          <img src={img4} alt=""/>         
           </div>
          <div>
          <img src={img5} alt=""/>          
  </div>*/}
        </Slider>


       </section>
    </>
  );
};

export default Services;
